(168, 'heading_service_page', 'DISCOVER – CREATE – CONNECT – INSPIRE', 'yes'),
(169, 'tagline_heading_service_page', 'We’re restive digital lovers with a craze for novelty.', 'yes'),
(170, 'des_heading_service_page', 'We take proper care of everything, offering complete digital solutions to our clients with an array of services that offer real value to their customers and profits to their brand. Outsource Designing uses creative digital marketing strategy to ensure your message is delivered to your audience.', 'yes'),
(171, 'learn_more_button_text_service_page', 'learn more', 'yes'),
(172, 'heading_services_prmotion', 'AMAZING TALENT. AMAZING RESULTS. WHAT ARE YOU WAITING FOR?', 'yes'),
(173, 'description_services_prmotion', 'Whether it’s your digital presence, online marketing strategy or a social marketing campaign, we have the people that make magic happen. At Outsource Designing, we\'re encircled by amazing talent who goes beyond for fantastic encounters. Let\'s create something amazing together to get you amazing results.', 'yes'),
(174, 'promo_button_text', 'request a quote', 'yes'),
(176, 'get_a_quote_text_description', 'MOBILE AND E-COMMERCE ARE MORE THAN A NECESSITY, THEY\'RE YOUR LIFE FORCE, YOUR HEART. AND ALTHOUGH WE ARE A FULL-SERVICE WEB DEVELOPMENT', 'yes'),
(177, 'get_a_quote_text_heaidng', 'Get a Quate', 'yes'),
(180, 'heading_agency_page', 'AGENCY', 'yes'),
(181, 'description_heading_agency_page', 'Outsource Designing isn\'t just a digital marketing agency. Certainly, we give over time trying out new approaches and checking up on newest trends, but we do not craft for our own collection - we design for our clients. What matters more to us is real and reckonable results. We know ROI, sales funnels and for this we work with you to reach goals and meet deadlines. Our digital marketing approach not only provides cutting edge performance but also a real ROI.', 'yes'),
(182, 'sub_heading_agency_page', 'OUR CREATIVITY ISN\'T THE ONLY THING THAT CONNECT: 5 YEARS OF DELIVERING THRIVING', 'yes');
