(187, 'inner_heading2_aboutus_agency', 'FIRST MEETING', 'yes'),
(188, 'inner_para1_aboutus_agency', 'We always listen and ask questions, and are honest in our answers. That’s what we promise.', 'yes'),
(189, 'inner_para2_aboutus_agency', 'and a free online meeting is for all of us before all work. You\'re warmly requested to attend.', 'yes'),
