(198, 'inner_para4_aboutus_agency', 'Our every digital strategy is unique and we do not offer the solution kit to every client..', 'yes'),
(199, 'inner_para5_aboutus_agency', 'Bring us confidence in, because you requested something from us that you cannot yourself.', 'yes'),
(200, 'inner_para6_aboutus_agency', 'We will provide the best brand experience for your customers because we are your digital partners.', 'yes'),
