(10, 1, '2019-03-26 04:00:42', '2019-03-26 04:00:42', 'SEO isn’t just about search engine rankings. It’s all about creating meaningful relationships with customers, building trust, addressing their concerns, and giving them quality content to read. At Outsource Designing, our tech geeks do all such things for a brand optimization. We build trustable brands for search engines with the keywords and terms that real people are searching for.\r\n\r\nWe create website relevant to users and not just to search engines. We help business owners to make smart decisions by educating on site analytics that helps in increase search engine rankings and website traffic.', 'SEO (SEARCH ENGINE OPTIMIZATION)', '', 'publish', 'closed', 'closed', '', 'seo-search-engine-optimization', '', '', '2019-03-26 04:00:42', '2019-03-26 04:00:42', '', 0, 'http://localhost/outsource/?post_type=movies&#038;p=10', 0, 'movies', '', 0),
(11, 1, '2019-03-26 04:00:56', '2019-03-26 04:00:56', 'With the evolution of social media, people are becoming more and more social. They like to connect with others and share their experiences and knowledge. At Outsource Designing, we create brand engagement through social media marketing to get people sharing.\r\n\r\nOur goal is to provide quality social media management that\'s accessible and cost-effective for any business size, globally. Before forming a social media strategy, our social media experts carefully researches the targeted user’s needs to create a message that resonates with the brand and provide opportunities digital success.', 'SOCIAL MEDIA', '', 'publish', 'closed', 'closed', '', 'social-media', '', '', '2019-03-26 04:00:56', '2019-03-26 04:00:56', '', 0, 'http://localhost/outsource/?post_type=movies&#038;p=11', 0, 'movies', '', 0),
(12, 1, '2019-03-26 04:01:06', '2019-03-26 04:01:06', 'Outsource Designing delivers data driven and results oriented brand identity services for all kinds of businesses, products and services. Brand Identity defines an exclusive and steady look, impression, strength and voice for all messages that tells your brand story and shows its uniqueness.\r\n\r\nThe brand identity process at Outsource Designing includes target audience analysis, competition analysis, and identifying your brand uniqueness. The thorough research enables us to create unique brand identities.', 'BRAND IDENTITY', '', 'publish', 'closed', 'closed', '', 'brand-identity', '', '', '2019-03-26 04:01:16', '2019-03-26 04:01:16', '', 0, 'http://localhost/outsource/?post_type=movies&#038;p=12', 0, 'movies', '', 0),
