(39, 1, '2019-03-26 06:20:31', '2019-03-26 06:20:31', 'SEO is the process of getting your website ranked in search engines like Google for targeted keywords. SEO is the most important aspects of digital marketing and is frequently easier said than done. At Outsource Designing, we do it easy with a confidence to get you rank greater than your rivals with effective optimization strategies. Our goal is to get more visitors in turn more leads for your business. It is as easy as creating unique titles tags, high-quality anchor-text and optimized images to boost your brand’s searchability. Our online marketing strategy will assist your business outreach to more customers.', 'Seo', '', 'publish', 'closed', 'closed', '', 'seo', '', '', '2019-03-27 10:34:27', '2019-03-27 10:34:27', '', 0, 'http://localhost/outsource/?post_type=services&#038;p=39', 0, 'services', '', 0),
(40, 1, '2019-03-26 06:20:50', '2019-03-26 06:20:50', 'Getting your marketing message out to your target clientele requires more than a campaign. Our years of experience in developing relationships have helped us in increasing your business reach. We craft content, design, social campaigns to ensure your brand gets success and relevance online. We create the visual identity aligned with your web design with a set of specific graphic posts, news, quotes, services and advertising. This kind of relationship provides your brand an edge over your competition. Ultimately, it comes down to who a user connects with that gets business.', 'social media', '', 'publish', 'closed', 'closed', '', 'social-media', '', '', '2019-03-27 10:34:27', '2019-03-27 10:34:27', '', 0, 'http://localhost/outsource/?post_type=services&#038;p=40', 0, 'services', '', 0),
