(189, 1, '2019-03-26 14:16:26', '2019-03-26 14:16:26', '<div class=\"span4\">\r\n<div class=\"caption\">We are CURIOUS to know about your business, workflow, tools, background and vision. Once we meet, we can work together to fortify your brand, explore new prospects, provide bespoke solutions by exploring new technologies that offer value to your brand.</div>\r\n</div>\r\n<div class=\"span4\"></div>', 'Curious', '', 'publish', 'closed', 'closed', '', 'curious', '', '', '2019-03-26 14:16:26', '2019-03-26 14:16:26', '', 0, 'http://localhost/outsource/?post_type=agency&#038;p=189', 0, 'agency', '', 0),
(190, 1, '2019-03-26 14:16:44', '2019-03-26 14:16:44', '<div class=\"span4\">\r\n<div class=\"caption\">We are EFFECTIVE people who will help you in your brand building with the help of integrated tools and consistency to your workflow. We help you in retaining your customers and keep them engaged by developing your strong digital presence.</div>\r\n</div>\r\n<div class=\"span4\"></div>', 'Effective', '', 'publish', 'closed', 'closed', '', 'effective', '', '', '2019-03-26 14:16:44', '2019-03-26 14:16:44', '', 0, 'http://localhost/outsource/?post_type=agency&#038;p=190', 0, 'agency', '', 0),
(191, 1, '2019-03-26 14:17:02', '2019-03-26 14:17:02', '<div class=\"container\">\r\n<div id=\"title\" class=\"row-fluid\">\r\n<div class=\"span4\">\r\n<div class=\"caption\">If you are looking for creative user interaction, new ways of digital communication and ways to boost business performance with interactive approach to draw interest in your brand – Believe it we are the PROACTIVE people!</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"agency\">\r\n<div class=\"container\"></div>\r\n</div>', 'Proactive', '', 'publish', 'closed', 'closed', '', 'proactive', '', '', '2019-03-26 14:17:02', '2019-03-26 14:17:02', '', 0, 'http://localhost/outsource/?post_type=agency&#038;p=191', 0, 'agency', '', 0),
(194, 1, '2019-03-27 10:20:53', '2019-03-27 10:20:53', 'Development is a confusing process – fortunately we’re here to make it simple. Whether you need a simple CMS or full ecommerce portal, we have got the expertise and skills to make your vision a reality. The experience the visitors and your potential clients will have greatly depends on their experience with your site. The positioning, site’s navigation, text and graphics all add to this experience. Throughout the design process, we educate you how to make your user experience an unforgettable one with our proactive approach.', '', '', 'publish', 'closed', 'closed', '', '194', '', '', '2019-03-27 10:20:53', '2019-03-27 10:20:53', '', 0, 'http://localhost/outsource/?p=194', 6, 'nav_menu_item', '', 0),
(195, 1, '2019-03-27 10:20:53', '2019-03-27 10:20:53', 'SEO is the process of getting your website ranked in search engines like Google for targeted keywords. SEO is the most important aspects of digital marketing and is frequently easier said than done. At Outsource Designing, we do it easy with a confidence to get you rank greater than your rivals with effective optimization strategies. Our goal is to get more visitors in turn more leads for your business. It is as easy as creating unique titles tags, high-quality anchor-text and optimized images to boost your brand’s searchability. Our online marketing strategy will assist your business outreach to more customers.', '', '', 'publish', 'closed', 'closed', '', '195', '', '', '2019-03-27 10:20:53', '2019-03-27 10:20:53', '', 0, 'http://localhost/outsource/?p=195', 7, 'nav_menu_item', '', 0),
(196, 1, '2019-03-27 10:20:53', '2019-03-27 10:20:53', 'Getting your marketing message out to your target clientele requires more than a campaign. Our years of experience in developing relationships have helped us in increasing your business reach. We craft content, design, social campaigns to ensure your brand gets success and relevance online. We create the visual identity aligned with your web design with a set of specific graphic posts, news, quotes, services and advertising. This kind of relationship provides your brand an edge over your competition. Ultimately, it comes down to who a user connects with that gets business.', '', '', 'publish', 'closed', 'closed', '', '196', '', '', '2019-03-27 10:20:53', '2019-03-27 10:20:53', '', 0, 'http://localhost/outsource/?p=196', 8, 'nav_menu_item', '', 0),
(201, 1, '2019-03-27 15:31:32', '0000-00-00 00:00:00', '', 'Auto Draft', '', 'auto-draft', 'closed', 'closed', '', '', '', '', '2019-03-27 15:31:32', '0000-00-00 00:00:00', '', 0, 'http://localhost/outsource/?post_type=movies&p=201', 0, 'movies', '', 0),
(202, 1, '2019-03-29 04:57:41', '2019-03-29 04:57:41', 'Outsource Designing delivers data driven and results oriented brand identity services for all kinds of businesses, products and services. Brand Identity defines an exclusive and steady look, impression, strength and voice for all messages that tells your brand story and shows its uniqueness.', 'BRAND IDENTITY', '', 'publish', 'closed', 'closed', '', 'brand-identity', '', '', '2019-03-29 05:36:04', '2019-03-29 05:36:04', '', 0, 'http://localhost/outsource/?post_type=works&#038;p=202', 0, 'works', '', 0),
(203, 1, '2019-03-29 05:44:07', '2019-03-29 05:44:07', 'With the evolution of social media, people are becoming more and more social. They like to connect with others and share their experiences and knowledge. At Outsource Designing, we create brand engagement through social media marketing to get people sharing.', 'SOCIAL MEDIA', '', 'publish', 'closed', 'closed', '', 'social-media', '', '', '2019-03-29 06:07:51', '2019-03-29 06:07:51', '', 0, 'http://localhost/outsource/?post_type=works&#038;p=203', 0, 'works', '', 0),
(204, 1, '2019-03-29 07:19:32', '2019-03-29 07:19:32', 'SEO isn’t just about search engine rankings. It’s all about creating meaningful relationships with customers, building trust, addressing their concerns, and giving them quality content to read. At Outsource Designing, our tech geeks do all such things for a brand optimization. We build trustable brands for search engines with the keywords and terms that real people are searching for.', 'SEO (SEARCH ENGINE OPTIMIZATION)', '', 'publish', 'closed', 'closed', '', 'seo-search-engine-optimization', '', '', '2019-04-01 14:05:08', '2019-04-01 14:05:08', '', 0, 'http://localhost/outsource/?post_type=works&#038;p=204', 0, 'works', '', 0),
