(13, 13, 'categories', 'Digital existence of every business starts its journey with a website, portal or blog, based on your market division. Individually of the used platform, it’s essential to be perceptive and engaging, being a lucrative communication funnel for your target customers. During the digital process, Outsource Designing works vigilantly with its clients to create an astounding online presence that fully signifies your business and its philosophy while ensuring it’s visually pleasing and user-friendly.', 0, 1),
(14, 14, 'categories', 'Getting your marketing message out to your target clientele requires more than a campaign. Our years of experience in developing relationships have helped us in increasing your business reach. We craft content, design, social campaigns to ensure your brand gets success and relevance online. We create the visual identity aligned with your web design with a set of specific graphic posts, news, quotes, services and advertising. This kind of relationship provides your brand an edge over your competition. Ultimately, it comes down to who a user connects with that gets business.', 0, 1),
(15, 15, 'categories', 'SEO is the process of getting your website ranked in search engines like Google for targeted keywords. SEO is the most important aspects of digital marketing and is frequently easier said than done. At Outsource Designing, we do it easy with a confidence to get you rank greater than your rivals with effective optimization strategies. Our goal is to get more visitors in turn more leads for your business. It is as easy as creating unique titles tags, high-quality anchor-text and optimized images to boost your brand’s searchability. Our online marketing strategy will assist your business outreach to more customers.', 0, 0),
(16, 16, 'categories', 'Development is a confusing process – fortunately we’re here to make it simple. Whether you need a simple CMS or full ecommerce portal, we have got the expertise and skills to make your vision a reality. The experience the visitors and your potential clients will have greatly depends on their experience with your site. The positioning, site’s navigation, text and graphics all add to this experience. Throughout the design process, we educate you how to make your user experience an unforgettable one with our proactive approach.', 0, 1),
(17, 17, 'categories', 'Digital existence of every business starts its journey with a website, portal or blog, based on your market division. Individually of the used platform, it’s essential to be perceptive and engaging, being a lucrative communication funnel for your target customers. During the digital process, Outsource Designing works vigilantly with its clients to create an astounding online presence that fully signifies your business and its philosophy while ensuring it’s visually pleasing and user-friendly.', 0, 1),
(18, 18, 'tag', 'asd', 0, 0),
(19, 19, 'categoriesa', '', 0, 4);
